class SquattingAnalysis:
    def __init__(self):
        self.db_conn = pymongo.MongoClient()
        self.result = {}
        self.perm_stats = {}

    # 获取一个app中定义的权限
    def _get_each_app_perm(self, component, app_perm):
        if 'android:permission' in component.keys():
            app_perm.append(component['android:permission'])
        if 'android:readPermission' in component.keys():
            app_perm.append(component['android:readPermission'])
        if 'android:writePermission' in component.keys():
            app_perm.append(component['android:writePermission'])

    # 统计已定义权限在不同的商店的app中的出现次数
    def _get_permission_stats(self, app_perm, store, installs):
        for perm in app_perm:
            if perm in self.perm_stats.keys():
                self.perm_stats[perm]['count'] = self.perm_stats[perm]['count'] + 1
            else:
                self.perm_stats[perm] = {"Anzhi": 0, "Appchina": 0, 'Xiaomi': 0, "360": 0, 'Coolapk': 0,
                                         'Baidu': 0, 'Google': 0, 'count': 1, 'installs': 0}
            self.perm_stats[perm][store] = self.perm_stats[perm][store] + 1
            self.perm_stats[perm]['installs'] = self.perm_stats[perm]['installs'] + installs

    # permission statistics
    # 统计不同的组件发生permission不一致的次数
    def _perm_count(self, record, store):
        # 分为不同的app进行统计
        app_perm = []
        comptypes = ['activity', 'provider', 'receiver', 'service']
        for comp in comptypes:
            if len(record[comp]) > 0:
                self.result[comp + '_count'] = self.result[comp + '_count'] + 1
                self.result[comp + '_' + store] = self.result[comp + '_' + store] + 1
                for r in record[comp]:
                    # 获取每一个组件中未定义的受保护权限
                    self._get_each_app_perm(r, app_perm)
        # app_perm是这条app记录中所有用来保护组件的权限
        # _get_permission_stats统计的是权限的数据，比如权限所影响的下载人数等等
        self._get_permission_stats(set(app_perm), store, record['installs'])

