def extract_all_info(manifests, mi_result, mobsf_dbname, if_update_download, dbname):
    # This function analyzes necessary information from AndroidManifest.xml files
    # and store the information into mongodb database "dbname".
    # 这个函数分析manifest文件，并将分析结果存储到violation数据库中
    utilities.extract_info_from_fest2db(manifests, if_update_download, dbname)
    # This function analyze the violations based on the log of ManifestInspector tool.
    # and store the violation info into mongodb database "dbname".
    # 这个函数分析ManifestInspector的分析结果，并将结果存储到violation数据库中
    utilities.extract_info_from_manifinspector2db(mi_result, dbname)
    # This function analyze the violations based on the output of mobsf.
    # and store the info into mongodb database "dbname".
    # 这个函数分析MobSF的分析结果，并将结果存储到violation数据库中
    # utilities.extract_info_from_mobsf2db(mobsf_dbname, dbname)
