    parser = argparse.ArgumentParser(description='This script is used to ')
    parser.add_argument("-m", "--manifest", help="android manifest files dir")
    parser.add_argument("-r", "--rescan", help="rescan the manifest files", type=int, default=0)
    parser.add_argument("-o", "--output", help="output excel file name", type=str, default="result.xlsx")
    # parser.add_argument("-g", "--google", help="only use the installation data from google play", type=int, default=1)
    parser.add_argument("-ud", "--updatedownload", help="update the installs of the apps", type=int, default=0)
    parser.add_argument("-db", "--database", help="The database to store the detection result", type=str,
                        default="testdb")
    parser.add_argument("-mi", "--miresult", help="The analysis result file of ManifestInspector.", type=str,
                        default="123.txt")
    parser.add_argument("-mobsf", "--mobsfdb", help="The database name that stores mobsf's analysis result.", type=str,
                        default="labpc_mobsf")
    args = parser.parse_args()
    analysis = SquattingAnalysis()
    # 这个函数是为了解析所有的manifest文件并将其中的关键信息存储到mongodb中
    # 第一个参数是manifest文件的路径
    # 第二个参数是只在获取下载量时是否只相信google的数据源，而不相信其他应用市场
    # 第三个参数是指定是否需要更新数据库中的下载量信息
    # 第一次分析的时候要执行这里来将所有manifest的信息导入，后面不需要再次分析
    # 提取的信息放在['PermSquatting']['permission']里面
    if args.rescan != 0:
        extract_all_info(args.manifest, args.miresult, args.mobsfdb, args.updatedownload, args.database)
        # utilities.extract_info_from_fest2db(args.manifest, args.google, args.updatedownload, args.database)
        # utilities.extract_info_from_manifinspector2db(args.miresult, args.google, args.database)
        # utilities.extract_info_from_mobsf2db(args.mobsfdb, args.google, args.database)

    workbook = Workbook()
    sheet = workbook.active
    line = 1
    # # 开始分析
    analysis.get_analysis(args.database)
    # v.keys()是p(1)-I(3)
    # v.values()是具体的数值
    # k是类别
    all_genre_stats = {}
    for k, v in analysis.result["genre_stats"].items():
        for kk, vv in v.items():
            if kk in all_genre_stats.keys():
                all_genre_stats[kk] = all_genre_stats[kk] + vv
            else:
                all_genre_stats[kk] = vv
    for k, v in analysis.result["genre_stats"].items():
        if line == 1:
            index = 2
            for violation_id in v.keys():
                sheet.cell(row=line, column=index).value = violation_id
                index = index + 1
            line = 2
        index = 2
        sheet.cell(row=line, column=1).value = k
        for violation_id in v.keys():
            if violation_id not in ["all", "any"] and all_genre_stats[violation_id]:
                sheet.cell(row=line, column=index).value = round(v[violation_id]/all_genre_stats[violation_id], 2)
            else:
                sheet.cell(row=line, column=index).value = v[violation_id]
            index = index + 1
        line = line + 1
    workbook.save(filename=args.output)
